      capabilities: Basic Install
      categories: Modernization & Migration
      certified: "false"
      containerImage: quay.io/windupeng/windup-operator-native:0.0.25
      createdAt: 01/22/24
      description: Windup is an analysis tool that supports the modernization and
        migration of Java applications.
      imagePullPolicy: Always
      operatorframework.io/suggested-namespace: windup
      repository: https://github.com/windup/windup-operator/
      support: https://issues.redhat.com/projects/WINDUP
    apiServiceDefinitions: {}
    crdDescriptions:
      owned:
      - description: "Create a Windup Web Console application.  \n\nTo access the
          Windup Web Console application from the \"Developer\" perspective, please
          go to Topology and click on the \"Open URL\" icon on the web-console pod.
          \ \n\nAlternatively from the \"Administrator\" perspective, please go to
          Networking->Routes and click on the Location hyperlink.  \n\nKnown issue
          \ \nIf you want to customize the Windup Web Console instance's parameters
          and you can not see any in the `Form view`, please switch to the `YAML view`
          and change them as needed.\n"
        displayName: Windup
        kind: Windup
        name: windups.windup.jboss.org
        version: v1
    description: |
      Windup is a web console application that supports large-scale Java application modernization and migration projects across a broad range of transformations and use cases.

      It analyzes application code, supports effort estimation, accelerates code migration, and enables users to move applications to containers.

      For more information please refer to the [https://windup.github.io/](https://windup.github.io/) page.
